import React, { useCallback, useEffect, useState } from "react";
import useCustomDiet from "../../hooks/useCustomDiet";
import useCustomLogin from "../../hooks/useCustomLogin";
import { Link, useParams } from "react-router-dom";
import Image from "react-bootstrap/Image";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import { getDietEach } from "../../api/dietApi";

const chooseSwitch = (choose) => {
  switch (choose) {
    case 1:
      return "ÏïÑÏπ®";
    case 2:
      return "Ï†êÏã¨";
    case 3:
      return "Ï†ÄÎÖÅ";
    case 4:
      return "Í∞ÑÏãù";
    default:
      return "ÏïÑÏπ®";
  }
};

const initState = {
  content: "",
  //picture: "",
  dateobject: "",
  updatedAt: "",
  id: "",
  quantity: 0,
  choose: "",
};

const DietReadComponent = () => {
  const [dietParam, setDietParam] = useState([{ ...initState }]);

  const { id, objectdate } = useParams();
  const {
    postDietC,
    moveToDietRead,
    moveToDietCreate,
    deleteDietC,
    moveToDietList,
  } = useCustomDiet();

  useEffect(() => {
    console.log("DietReadComponent.js useEffect() ÏßÑÏûÖ id=> ", id);

    //api
    const getDietEI = async () =>
      await getDietEach({ id, objectdate })
        .then((result) => {
          console.log(
            "DietReadComponent.js useEffect ÎÇ¥ getDietEach axios Ìò∏Ï∂úÌõÑ then() => ",
            result
          );
          setDietParam({ ...result.data });
        })
        .catch((err) => {
          console.log(
            "DietReadComponent.js useEffect ÎÇ¥ getDietEach axios Ìò∏Ï∂úÌõÑ catch() => ",
            err
          );
        });

    getDietEI();
  }, []);

  const deleteOnClick = (id) => {
    deleteDietC(id)
      .then((result) => {
        console.log("DietReadComponent.js deleteOnClick() then() => ", result);
        if (result.payload.result === "success") {
          alert(dietParam.dateobject + "ÏùºÏûêÏùò ÏãùÎã®Ïù¥ ÏÇ≠Ï†úÎêòÏóàÏäµÎãàÎã§.");

          moveToDietList();
        }
        if (result.payload.error === "error") {
          alert(dietParam.dateobject + "ÏùºÏûêÏùò ÏãùÎã® ÏÇ≠Ï†úÎ•º Ïã§Ìå®ÌñàÏäµÎãàÎã§.");
          moveToDietRead(dietParam.id);
        }
      })
      .catch((err) => {
        console.log("DietReadComponent.js deleteOnClick() catch() => ", err);
        alert(dietParam.dateobject + "ÏùºÏûêÏùò ÏãùÎã® ÏÇ≠Ï†úÎ•º Ïã§Ìå®ÌñàÏäµÎãàÎã§.");
        moveToDietRead(dietParam.id);
      });
  };

  return (
    <div className="container">
      <br />
      <br />

      <h4>ÏãùÎã®Ï°∞Ìöå</h4>
      <hr />
      <br />
      {dietParam.map((i, index) => (
        <React.Fragment key={i.id}>
          <Form>
            <Form.Group className="mb-3">
              <Form.Label>ÏãùÎã®ÏùºÏûê</Form.Label>
              <Form.Control
                type="text"
                name="dateobject"
                value={dietParam[i].dateobject}
                disabled
              />
              <Form.Text className="text-muted"></Form.Text>
            </Form.Group>
            <Form.Group className="mb-3">
              <Form.Label>ÏãúÍ∞Ñ</Form.Label>
              <Form.Control
                type="text"
                name="content"
                value={chooseSwitch(dietParam[i].choose)}
                disabled
              />
            </Form.Group>
            <Form.Group className="mb-3">
              <Form.Label>ÏãùÎã®ÎÇ¥Ïö©</Form.Label>
              <Form.Control
                type="text"
                name="content"
                value={dietParam[i].content}
                disabled
              />
            </Form.Group>
            <Form.Group className="mb-3">
              <Form.Label>Ïñë(Îã®ÏúÑ g/ml)</Form.Label>
              <Form.Control
                type="text"
                name="quantity"
                value={dietParam[i].quantity}
                disabled
              />
            </Form.Group>
            {/* <Form.Group controlId="formFile" className="mb-3">
          <Form.Label>ÏÇ¨ÏßÑ</Form.Label>
          <br />
          {dietParam.picture ? (
            <Image
              src={`http://localhost:8001/img/${dietParam.picture}`}
              rounded
            />
          ) : (
            <>ÏóÖÎ°úÎìúÌïòÏßÄ ÏïäÏùåüòÖ</>
          )}
          <Form.Control type="file" name="picture" /> 
        </Form.Group> */}
            <br />
            <br />
            <Link to={`../modify/${dietParam[i].id}`}>
              {" "}
              <Button variant="outline-primary">ÏãùÎã® ÏàòÏ†ïÏù¥Îèô</Button>
            </Link>
            &nbsp;&nbsp;
            <Button
              variant="outline-danger"
              type="button"
              onClick={deleteOnClick(`${dietParam[i].id}`)}
            >
              ÏÇ≠Ï†úÌïòÍ∏∞
            </Button>
            &nbsp;&nbsp;
          </Form>
        </React.Fragment>
      ))}
      <Link to={`../`}>
        {" "}
        <Button variant="outline-secondary">ÏãùÎã® Îã¨Î†•Ïù¥Îèô</Button>
      </Link>
      <br />
      <br />
    </div>
  );
};

export default DietReadComponent;
